import React from "react";
import "./C.css";
import Service from "../service/Service";

class Android extends React.Component{
    constructor(props){
        super(props)
        this.state={
            androids:[]
        }
    }
    componentDidMount(){
        Service.getAndroid().then((response) => {
            this.setState({androids:response.data})

        });
    }
    render(){
        return(
            <div className="html">
            <div className="feed-item">
                <h2 class="text-center">Android Tutorial</h2>
                <table className="table table-striped">
                    <thead>
                        <tr>
                            {/* <td>Html id</td>
                            <td>Name</td>
                            <td>Text</td>
                            <td>Image</td> */}
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.androids.map(
                                android =>
                                <tr key ={android.id}>
                                    {/* <td>{android.id}</td> */}
                                    <td>{android.name}</td>
                                    {/* <td>{html.text}</td>
                                    <td>{html.image}</td>  */}
                                </tr>
                            )
                        }
                    </tbody>
                </table>

            </div>
            <div className="content-item">
                    <h1>Content of Feed item</h1>
                    <h1>Content of Feed item</h1>
                    <h1>Content of Feed item</h1>
